import React from 'react';
import { Menubar } from 'primereact/menubar';
import { InputText } from 'primereact/inputtext';
import { MenuItem as PrimeMenuItem } from 'primereact/menuitem';
import { Badge } from 'primereact/badge';
import { Avatar } from 'primereact/avatar';  
import Logo from '../../../assets/brandlogos/logo.png'
interface MenuItemWithBadge extends Omit<PrimeMenuItem, 'items'> {
    badge?: number;
    shortcut?: string;
    separator?: boolean;
    label?: string;
    items?: MenuItemWithBadge[];
}

export default function Navbar() {

    const items: MenuItemWithBadge[] = [
        {
            label: 'About us',
        },
        {
            label: 'News room',
        },
        {
            label: 'Blog',
        },
        {
            label: 'Business',
            items: [
                {
                    label: 'Core',
                    icon: 'pi pi-bolt',
                    shortcut: '⌘+S',
                },
                {
                    label: 'Blocks',
                    icon: 'pi pi-server',
                    shortcut: '⌘+B',
                },
                {
                    label: 'UI Kit',
                    icon: 'pi pi-pencil',
                    shortcut: '⌘+U',
                },
                {
                    separator: true
                },
                {
                    label: 'Templates',
                    icon: 'pi pi-palette',
                    items: [
                        {
                            label: 'Apollo',
                            icon: 'pi pi-palette',
                            badge: 2,
                        },
                        {
                            label: 'Ultima',
                            icon: 'pi pi-palette',
                            badge: 3,
                        }
                    ]
                }
            ]
        },

    ];

    const start = <img alt="logo" src={Logo} height="40" className="mr-2" />;
    const end = (
        <div className="flex align-items-center gap-2">
            <h2>Coins</h2>
            <Avatar image="https://primefaces.org/cdn/primereact/images/avatar/amyelsner.png" shape="circle" />
        </div>
    );

    return (
        <div className="card">
            <Menubar model={items as PrimeMenuItem[]} start={start} end={end} />
        </div>
    );
}
